    - type: Paper
      content: >-
        Кароче мы забираем абсолютно ВСЕ, что поможет нам уничтожить этих корпоратов! Наши любимые игрушки долго ждали своего часа и вот он настал. Христов, тесла-пушка, сверхтяжелые эксперементальные скафандры... Мы возмём все, снесем парочку станций с лица космоса и вернёмся, как лучшие мародёры Горлекса!


        Когда закончим со своей резней, вернем экипировку на место, чтоб малыши вроде вас тоже смогли уничтожить парочку активов NanoTrasen.
  - uid: 2282
    components:
    - type: Transform
      pos: -8.201534,25.650993
      parent: 1
    - type: Paper
      content: >2


         Не имея видимости будущего, мы продолжаем движение вперёд. Словно путь светит и общается с нами.

        - "Это твоё начало, всё еще впереди."


        - "Скоро ты увидишь новое."


        Но доходя до конечной, этот голос покидает нас. И среди всего пространства темноты, что окружало нас, мы находим лишь тень своей жизни.


        - "Это твой конец."

        Говоришь себе ты.
